import DetailedPalette from './DetailedPalette';
import Modal from './Modal';
import { useState } from 'react';
import Home from './Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';    

function App() {

  const [showModal, setShowModal] = useState(false)
  const [color, setColor] = useState('')

  const palette = {
    one : '#eccc68',
    two : '#ff7f50',
    three : '#ff6b81',
    four : '#ffa502',
    five : '#ff6348',
    six : '#ff4757',
    seven : '#7bed9f',
    eight : '#70a1ff',
    nine : '#5352ed'
    
  }

  console.log(palette)
  return (
    <Router>
      <Switch>
        <Route exact path="/" component = { Home } palette={palette} setPalette={setPalette}></Route>
        <Route exact path="/palette/:paletteName" component = { DetailedPalette } palette={palette}/>
      </Switch>
    </Router>
    // <>
    //   {showModal ? <Modal showModal={showModal} setShowModal={setShowModal} color={color} /> : 
    //   <DetailedPalette color={color} setColor={setColor} setShowModal={setShowModal} />}
    // </>
    
  );
}

export default App;
